import s from './MyPosts.module.css';
import Post from "./Post/Post";


const MyPosts = () => {
    let postsData = [
        {id: 1, post: 'How are you?', likeCount: '5'},
        {id: 2, post: 'It\'s my first test!', likeCount: '0'},
        {id: 3, post: 'All right?', likeCount: '777'},
        {id: 4, post: 'What are you doing?', likeCount: '1000'}
    ]

    let postsElements = postsData.map(posts => <Post message={posts.post} likesCount={posts.likeCount} />);

    return (
        <div className={s.postsBlock}>
            <h3>My post</h3>
            <div>
                <div>
                    <textarea>Text</textarea>
                </div>
                <div>
                    <button>Button</button>
                </div>
            </div>
            <div className={s.posts}>
                {postsElements}
                // <Post message={postsData[1].post} likesCount={postsData[0].likeCount} />
                // <Post message='It is my first test!' likesCount='0' />
                // <Post message='What are you doing?' likesCount='777' />
            </div>
        </div>
    )
}

export default MyPosts;
